module image_processor(
    input clk_vga,
    input rst_game_n,
    input [9:0] x_i,
    input [9:0] y_i,
    input [9:0] x_chr_i,
    input [9:0] y_chr_i,
    input [9:0] x_obs_i,
    input [9:0] y_obs_i,
    output reg [3:0] red_o,
    output reg [3:0] green_o,
    output reg [3:0] blue_o
    );

    // Set the parameters
    localparam IMG_WIDTH = 45;
    localparam IMG_HEIGHT = 51;

    localparam ORIGIN_LOC_X = 110;
    localparam ORIGIN_LOC_Y = 183;
    localparam ORIGIN_WIDTH = 400;
    localparam ORIGIN_HEIGHT = 157;

    localparam END_LOC_X = 120;
    localparam END_LOC_Y = 150;
    localparam END_WIDTH = 400;
    localparam END_HEIGHT = 165;

    localparam SCORE_LOC_X = 5;
    localparam SCORE_LOC_Y = 5;
    localparam SCORE_WIDTH = 96;
    localparam SCORE_HEIGHT = 30;

    localparam SCREEN_WIDTH = 640;
    localparam SCREEN_HEIGHT = 480;

    localparam DIGIT_WIDTH = 24;
    localparam DIGIT_HEIGHT = 30;

    wire in_image_area, in_obstacle_area, in_origin_area, in_end_area, in_score_area, in_digit_hundreds, in_digit_tens, in_digit_ones; // Check whether the pixel is in the target area or not
    wire [11:0] rom_pixel_data_cat_1, rom_pixel_data_cat_2; // Store the data from rom_ip
    wire [9:0] img_x, img_y, end_x, end_y, origin_x, origin_y, score_x, score_y;
    wire [9:0] digit_hundreds_x, digit_hundreds_y, digit_tens_x, digit_tens_y, digit_ones_x, digit_ones_y;

    wire crash_flag;
    wire [3:0] bcd_hundreds, bcd_tens, bcd_ones;

    wire [ORIGIN_WIDTH - 1 : 0] origin_game_image [ORIGIN_HEIGHT - 1 : 0];
    wire [END_WIDTH - 1 : 0] end_game_image [END_HEIGHT - 1 : 0];
    wire [SCORE_WIDTH - 1 : 0] score_image [SCORE_HEIGHT - 1 : 0];
    wire [DIGIT_WIDTH - 1 : 0] digit_image [9:0] [DIGIT_HEIGHT - 1 : 0];
    wire [DIGIT_WIDTH - 1 : 0] digit_hundreds [DIGIT_HEIGHT - 1 : 0];
    wire [DIGIT_WIDTH - 1 : 0] digit_tens [DIGIT_HEIGHT - 1 : 0];
    wire [DIGIT_WIDTH - 1 : 0] digit_ones [DIGIT_HEIGHT - 1 : 0];

    reg end_game, clk_cat;
    reg prev_x_chr_obs_equal;
    reg [19:0] cnt;
    reg [7:0] score;
    
    // Check whether the pixel is in the target area or not
    assign in_image_area = (x_i >= x_chr_i + 5) && (x_i < x_chr_i + IMG_WIDTH) && (y_i >= y_chr_i) && (y_i < y_chr_i + IMG_HEIGHT);
    assign in_obstacle_area = (x_i >= x_obs_i) && (x_i <= x_obs_i + 15) && ((y_i >= y_obs_i) || (y_i <= y_obs_i - 100));
    assign in_origin_area = (x_i >= ORIGIN_LOC_X) && (x_i < ORIGIN_LOC_X + ORIGIN_WIDTH) && (y_i >= ORIGIN_LOC_Y) && (y_i < ORIGIN_LOC_Y + ORIGIN_HEIGHT);
    assign in_end_area = (x_i >= END_LOC_X) && (x_i < END_LOC_X + END_WIDTH) && (y_i >= END_LOC_Y) && (y_i < END_LOC_Y + END_HEIGHT);
    assign in_score_area = (x_i >= SCORE_LOC_X + 2) && (x_i < SCORE_LOC_X + SCORE_WIDTH) && (y_i >= SCORE_LOC_Y) && (y_i < SCORE_LOC_Y + SCORE_HEIGHT);
    assign in_digit_hundreds = (x_i >= SCORE_LOC_X + SCORE_WIDTH +2) && (x_i < SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH) && (y_i >= SCORE_LOC_Y) && (y_i < SCORE_LOC_Y + SCORE_HEIGHT);
    assign in_digit_tens = (x_i >= SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH + 2) && (x_i < SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH + DIGIT_WIDTH) && (y_i >= SCORE_LOC_Y) && (y_i < SCORE_LOC_Y + SCORE_HEIGHT);
    assign in_digit_ones = (x_i >= SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH + DIGIT_WIDTH + 2) && (x_i < SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH + DIGIT_WIDTH + DIGIT_WIDTH) && (y_i >= SCORE_LOC_Y) && (y_i < SCORE_LOC_Y + SCORE_HEIGHT);

    // Compute the delta position
    assign img_x = x_i - x_chr_i;
    assign img_y = y_i - y_chr_i;
    assign end_x = x_i - END_LOC_X;
    assign end_y = y_i - END_LOC_Y;
    assign origin_x = x_i - ORIGIN_LOC_X;
    assign origin_y = y_i - ORIGIN_LOC_Y;
    assign score_x = x_i - SCORE_LOC_X;
    assign score_y = y_i - SCORE_LOC_Y;
    assign digit_hundreds_x = x_i - (SCORE_LOC_X + SCORE_WIDTH);
    assign digit_hundreds_y = y_i - SCORE_LOC_Y;
    assign digit_tens_x = x_i - (SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH);
    assign digit_tens_y = y_i - SCORE_LOC_Y;
    assign digit_ones_x = x_i - (SCORE_LOC_X + SCORE_WIDTH + DIGIT_WIDTH + DIGIT_WIDTH);
    assign digit_ones_y = y_i - SCORE_LOC_Y;

    // Check crash
    assign crash_flag = (red_o == 4'd0 && green_o == 4'd8 && blue_o == 4'd8) && rom_pixel_data_cat_1 && rom_pixel_data_cat_2;

    // Import the data from rom_ip
    rom_ip_cat_1 rom_cat1_inst (
        .clka(clk_vga),
        .addra(img_y * IMG_WIDTH + img_x),
        .douta(rom_pixel_data_cat_1)
    );

    rom_ip_cat_2 rom_cat2_inst (
        .clka(clk_vga),
        .addra(img_y * IMG_WIDTH + img_x),
        .douta(rom_pixel_data_cat_2)
    );

    // Turn the binary-code into bcd-code
    binary_to_bcd bin_to_bcd (
        .binary_in(score),
        .bcd_hundreds(bcd_hundreds),
        .bcd_tens(bcd_tens),
        .bcd_ones(bcd_ones)
    );

    genvar i;
    generate
        for (i = 0; i < DIGIT_HEIGHT; i = i + 1) begin
            assign digit_hundreds[i] = digit_image[bcd_hundreds][i];
            assign digit_tens[i] = digit_image[bcd_tens][i];
            assign digit_ones[i] = digit_image[bcd_ones][i];
        end
    endgenerate


    always @(posedge clk_vga, negedge rst_game_n) begin
        if (!rst_game_n) begin
            clk_cat <= 0;
            end_game <= 0;
            cnt <= 0;
            score <= 0;
            prev_x_chr_obs_equal <= 0;
            if (in_origin_area && origin_game_image[ORIGIN_HEIGHT - 1 - origin_y][ORIGIN_WIDTH - origin_x]) begin
                red_o <= 4'h0;
                green_o <= 4'h0;
                blue_o <= 4'h0;
            end else begin
                red_o <= 4'hf;
                green_o <= 4'hf;
                blue_o <= 4'hf;
            end
        end else begin
            cnt <= cnt + 1;
            prev_x_chr_obs_equal <= (x_chr_i == x_obs_i);
            // Generate the clock for the cat changing its behavior
            if (cnt == 0) begin
                clk_cat <= ~clk_cat;
            end else begin
                clk_cat <= clk_cat;
            end
            // Compute the score
            if ((x_chr_i == x_obs_i) && ~prev_x_chr_obs_equal && ~end_game) begin
                score <= score + 1;
            end else begin
                score <= score;
            end
            // Generate the image according to some priority
            if (~end_game && in_image_area && crash_flag) begin
                end_game <= 1;
            end else if (~end_game && in_image_area) begin
                red_o <= clk_cat ? rom_pixel_data_cat_1[11:8] : rom_pixel_data_cat_2[11:8];
                green_o <= clk_cat ? rom_pixel_data_cat_1[7:4] : rom_pixel_data_cat_2[7:4];
                blue_o <= clk_cat ? rom_pixel_data_cat_1[3:0] : rom_pixel_data_cat_2[3:0];
            end else if (in_score_area && score_image[SCORE_HEIGHT - 1 - score_y][SCORE_WIDTH - score_x]) begin
                red_o <= 4'h0;
                green_o <= 4'h0;
                blue_o <= 4'h8;
            end else if (in_digit_hundreds && digit_hundreds[DIGIT_HEIGHT - 1 -digit_hundreds_y][DIGIT_WIDTH - digit_hundreds_x]) begin
                red_o <= 4'h0;
                green_o <= 4'h0;
                blue_o <= 4'h8;
            end else if (in_digit_tens && digit_tens[DIGIT_HEIGHT - 1 -digit_tens_y][DIGIT_WIDTH - digit_tens_x]) begin
                red_o <= 4'h0;
                green_o <= 4'h0;
                blue_o <= 4'h8;
            end else if (in_digit_ones && digit_ones[DIGIT_HEIGHT - 1 -digit_ones_y][DIGIT_WIDTH - digit_ones_x]) begin
                red_o <= 4'h0;
                green_o <= 4'h0;
                blue_o <= 4'h8;
            end else if (in_obstacle_area && ~end_game) begin
                red_o <= 4'h0;
                green_o <= 4'h8;
                blue_o <= 4'h8;
            end else if (end_game && in_end_area && end_game_image[END_HEIGHT - 1 - end_y][END_WIDTH - end_x]) begin
                red_o <= 4'hf;
                green_o <= 4'h0;
                blue_o <= 4'h0;
            end else begin
                red_o <= 4'hf;
                green_o <= 4'hf;
                blue_o <= 4'hf;
            end
        end
    end

    // Store the image data through LUT
